eateElement("div",{className:"agreementText"},"（2）您将第三方管理的账户与您的微众银行账户相关联，并授权微众银行访问此类信息，表示您同意微众银行在遵守本政策的前提下，收集、存储、使用和分享此类信息。例如，我们可以根据您的授权收集您通过社交媒体网站或社交工具软件等途径提供的信息。我们通过此种途径收到的信息因具体提供的网站而异，并受提供信息的网站控制。"),u["default"].createElement("div",{className:"agreementText"},"（3）我们还可能会以其他方式收集有关您的其他信息，例如，通过您与我们的客户服务团队联系收集您的信息、当您对调查做出答复时收集相关结果。"),u["default"].createElement("div",{className:"agreementText"},"2.为了遵守国家相关法律法规的规定，以及为向您提供服务及提升服务质量、向您提供安全、顺畅、高效和个性化的体验的目的，我们收集的信息范围主要包括以下内容："),u["default"].createElement("div",{className:"agreementText"},"（1）您在注册、使用微众银行账户或微众银行服务时，向我们提供的您的QQ号码、微信号、手机号码或电子邮箱、真实姓名、证件号码、用户照片或是我们要求您提供的其他信息（包括但不限于银行卡号）。我们通过这些信息识别您的身份，以便遵守国家相关法律法规的规定，为您提供服务。"),u["default"].createElement("div",{className:"agreementText"},"（2）您使用的微众银行服务需与您的银行账户等账户关联方能实现时，您需要向我们提供您的银行账户等账户信息。例如，您在开通微众银行账户，将您的银行卡与微众银行账户绑定时，您需向我们提供您的银行卡信息。"),u["default"].createElement("div",{className:"agreementText"},"（3）您使用微众银行服务过程中所产生的支付业务及交易信息，包括但不限于交易双方名称、交易金额、交易时间、交易双方的开户银行名称、银行账户号码等相关信息。您可以通过我们查询您的支付状态或历史交易记录。"),u["default"].createElement("div",{className:"agreementText"},"（4）我们可能会收集您使用微众银行服务的相关操作信息，包括但不限于您的硬件设备型号、您所使用的软件版本信息、您的IP地址、您所在的位置、移动网络信息、标准网络日志数据和其他信息，以尽最大努力保护您的账户安全。"),u["default"].createElement("div",{className:"agreementText"},"三、关于Cookies和其他浏览器技术"),u["default"].createElement("div",{className:"agreementText"},"1.当您使用微众银行服务的时候，我们可能会保存您的用户登录状态并且为您分配一个或多个“Cookie”（一个很小的文本文件），例如：当用户访问一个需要用户登录才可以提供的信息或服务，当用户登录时，我们会把该用户的登录名和密码加密存储在用户计算机的Cookie文件中，由于是不可逆转的加密存储，其他人即使可以使用该用户的计算机，也无法识别出用户的用户名和密码。用户并不需要额外做任何工作，所有的收集、保存和加密工作都由系统自动完成。"),u["default"].createElement("div",{className:"agreementText"},"2.Cookie文件将保存在您的计算机硬盘或设备终端的闪存上，它只能被设置它们的服务器阅读，而且不能执行任何代码或病毒。您可以随时使用浏览器或操作系统软件将其删除。"),u["default"].createElement("div",{className:"agreementText"},"3.为了向您提供更为方便、快捷、顺畅、个性化的服务，我们通过Cookie等技术为您提供以下服务："),u["default"].createElement("div",{className:"agreementText"},"（1）记住您的账户和密码。例如，cookie可能帮助您省去为使用微众银行服务而重复输入账户和密码。"),u["default"].createElement("div",{className:"agreementText"},"（2）分析您使用微众银行服务的情况。例如，我们可通过cookie、web beacon等技术来了解您使用微众银行服务的具体用途，或哪些网页或服务最受您的欢迎。"),u["default"].createElement("div",{className:"agreementText"},"（3）广告优化。微众银行可能会根据您访问相关网站的统计信息为您显示您可能感兴趣的产品或广告信息。这些统计信息并不包括您的任何个人信息，这些信息可能被用来评估广告的有效度。Cookie、web beacon等技术有助于我们根据您的信息，向您提供与您相关的广告而非进行普遍的广告投放。"),u["default"].createElement("div",{className:"agreementText"},"（4）微众银行也可能通过web beacon技术来统计匿名访问的数据，同样，这些统计信息并不包括您的个人信息。"),u["default"].createElement("div",{className:"agreementText"},"4.您也可以选择“不使用Cookie”或“在使用Cookie时事先通知我”的选项禁止Cookie的产生，但是可能会影响您对某些微众银行服务的使用，或是您无法享受到更加安全、快捷、顺畅、个性化的服务。"),u["default"].createElement("div",{className:"agreementText"},"四、Cookie和web beacon技术也可能会由微众银行的第三方广告合作伙伴使用。这些第三方通过cookie和web beacon收集和使用该等信息的行为，不受本政策约束，而是受该第三方的隐私政策约束，我们不对第三方的cookie或web beacon承担责任。"),u["default"].createElement("div",{className:"agreementText"},"五、我们与您如何保护和存储信息"),u["default"].createElement("div",{className:"agreementText"},"1.我们在法律法规等相关规定要求的时限内收集和存储您的信息，并依法对这些信息进行严格保密。"),u["default"].createElement("div",{className:"agreementText"},"2.为了保障您的信息安全，微众银行会在现有技术水平下采取合理必要的措施来保护您的信息，采取物理、技术和行政管理安全措施来降低丢失、误用、非授权访问、披露和更改的风险，包括但不限于传输层数据加密、防火墙和加密存储、物理访问控制以及信息访问授权控制。为此我们设置了安全程序保护您的信息不会被未经授权的访问所窃取。所有的个人信息被加密储存并放置于专业防火墙内，并请您理解并明白，由于存在的各种各样的恶意手段，即便微众银行尽力采取上述措施，您的信息仍有可能被泄漏、毁损或灭失。我们对此不承担任何承诺或保证，也对此不负任何责任。"),u["default"].createElement("div",{className:"agreementText"},"3.您应审慎使用微众银行服务，并妥善保护好您的个人信息。"),u["default"].createElement("div",{className:"agreementText"},"4.您在使用微众银行服务时，请妥善保管好您的微众银行账号及其密码，我们会通过您的账号及其密码来识别您的身份。一旦您泄漏了微众银行账号及其密码，您可能会丢失您的信息，并可能产生对您不利的法律后果。如您发现您的账号及其密码因任何原因已经或将受到泄漏时，您应该立即和我们取得联系，但在我们知悉此种情况和采取行动前，我们对此不负任何责任。"),u["default"].createElement("div",{className:"agreementText"},"5.您可以随时登录自己的账户查看或根据系统要求修改账户设置和信息，但出于安全性和身份识别等方面的考虑，身份证件等敏感信息可能进行部分掩码隐藏，同时，您可能无法修改注册或激活时提供的某些信息。"),u["default"].createElement("div",{className:"agreementText"},"六、我们可能如何使用信息"),u["default"].createElement("div",{className:"agreementText"},"如上所述，基于国家相关法律法规的规定，以及为向您提供服务及提升服务质量、向您提供安全、顺畅、高效和个性化的体验的目的（包括支持我们开发新产品或完善已有产品功能），您同意我们可能将收集的您的相关信息用作下列用途："),u["default"].createEl